docs/gettingStarted/AsynchronousActionCr.body:
Asynchronous action creators
If you made it this far, you just built a todo list application using GlueStick and the array of frameworks it glues together for you! Hip Hip Hooray! You’ll notice that refreshing the web browser resets the list to the initial state. That is because you haven’t done anything to persist the data yet. You could keep things in the browser by using LocalStorage or hitting a server API in your action creators.
GlueStick gives you a couple middleware functions for your Redux store: Redux Thunk and our own Promise middleware.
Creating an action creator that needs to hit an API should be done with the Promise middleware. Here is an example of what that would look like:
export function getTodos () {
  return {
    type: "GET_TODOS",
    promise: new Promise((resolve) => {
      someAsyncMethod((result) => {
        resolve(result);
      });
    })
  };
}

The promise middleware can fire off three of its own actions. If your action type is GET_TODOS, then it will first dispatch GET_TODOS_INIT. It is up to you if you want to handle this action or not. This is a good place to update the state to show a loading spinner.
GET_TODOS will only be triggerd once the promise resolves. When you call resolve from inside your promise, any value passed to the resolve method will be available on the action object under as action.value.
GET_TODOS_FAILURE will be triggered if the promise fails to resolve. This gives you the chance to notify the user that something went wrong.

docs/gettingStarted/PrefetchingWithFetch.body:
Prefetching data with fetchData
Earlier, we mentioned the static fetchData method. React Router allows you to call a method before rendering a component. In this case, all of the containers have the opportunity to let the server and client know if you need to fetch data before showing the component.
To use this method, create an action creator using the Promise middleware and return the result of dispatching that action.
Example:
import React, { Component } from "react";
import { bindActionCreators } from "redux";
import { connect } from "react-redux";

import TodoList from "../components/TodoList";
import { getTodos, addTodo } from "../actions/todos";

@connect(
  (state) => ({todos: state.todos}),
  (dispatch) => bindActionCreators({addTodo}, dispatch)
)
export default class Todos extends Component {
  static fetchData ({dispatch}) {
    // It is important you `return` the result and that you pass the result of
    // `getTodos()`, not the the function itself. Lastly make sure getTodos()
    // returns an action using the promise middleware so the the dispatch method
    // returns a promise.
    return dispatch(getTodos());
  }

  render () {
    return (

    );
  }
}

docs/Configuration.html.body:
Configuration
There are few files which allow configuration of Gluestick:

src/entires.json - define entries (apps)
src/vendor.js - Define vendored modules/packages
src/gluestick.hooks.js - define hooks which will run on specific lifecycle events
src/gluestick.plugins.js - specify which plugins to use
src/gluestick.config.js - overwrite gluestick config
src/webpack.hooks.js - overwrite webpack client and server configuation
src/config/application.js - global project configuration
src/config/caching.server.js - setup component caching
src/config/init.browser.js - specify code which will run right before client bundle is run in browser
src/config/redux-middleware.js - specify additional redux middleware and overwrite thunk middleware

Redux config
All redux configuration can be specified in the src/config/redux-middleware.js file.
The default export should return an array of additional middlewares.
To specify custom thunk middleware, export it using named thunkMiddleware export:
export default []; // additional middlewares
export const thunkMiddleware = thunk.withExtraArgument({ api: /* ... */ });
This allows you to inject a custom argument.
IMPORTANT: This configuration is project wide, meaning it will be used for every app/entrypoint.
If you need to overwrite it for a specific app/entrypoint, you must create a configuration file for this
app/entrypoint, update src/entries.json to use that file (more on this here)
and write an additional property reduxOptions: { middlewares: Function[], thunk: ?Function }.
Global project config
All project-wide configuration lives here in src/config/application.js.
GlueStick itself will look only for these properties:

proxies - setup additional proxies
httpClient - configure http client
headContent - configure page  element
logger - configure logger

However, you can put your own properties here and read them by importing this files via the alias
config/application.
This configuration file should have the following structure:
type HeadContent = {
  title: string;
  titleTemplate: string;
  meta: { name: string, content: string }[];
}

type Logger = {
  pretty: boolean;
  level: string;
}

type EnvConfig = {
  head: HeadContent;
  logger: Logger;
  httpClient?: Object;
  proxies?: [{
    path: string;
    destination: string;
    options?: Object;
    filter?: Function;
  }];
}

const config: EnvConfig = {
  head: {
    title: 'My Gluestick App',
    titleTemplate: '%s | Gluestick Application',
    meta: [
      { name: 'description', content: 'Gluestick application' }
    ]
  }
  logger: {
    pretty: true,
    level: 'info',
  }
}

export default config;

Gluestick config
To modify the GlueStick config use src/gluestick.config.js. It must return a function or array of functions
as a default export:
export default config => config;
// or
export default [config => config];
This function accepts the gluestick config (object) as a first argument and must return the modified
config.
For example, this code snippet overwrites the default ports:
export default config => ({
  ...config,
  ports: {
    client: 1111,
    server: 2222,
  }
})
To modify the path to asset files (previously known as assetPath), define publicPath and assign a value in the Gluestick config, for example:
export default config => ({
  ...config,
  publicPath: process.env.ASSET_URL || '/assets/',
});
To see what the default GlueStick config looks like, see here.
Vendoring
Some packages or modules like React don't change frequently, so they can be vendored.
In order to do so, import the desired module/file in src/vendor.js. This file will become a separate entry
used by either:

CommonsChunkPlugin:
build vendor as a normal bundle
rebuild automatically when changed
preferred for code that changes kind of frequently at a cost of increased build time
automatic common modules extraction to vendor bundle
great for smaller and medium sized projects



or

DllPlugin:
create Dynamicaly Linked Library with vendored modules
no automatic rebuilds
prefered for code that changes rarely
shared between parallel builds
great for bigger projects



CommonsChunkPlugin is used by default, since it doesn't require any changes to be made or commands
to be run.

Please note, that CommonsChunkPlugin and DllPlugin are not interoperable, so it's up to you to decide
which one suits your project better.

If you want to use DllPlugin, you firstly need to execute gluestick build --vendor (for production add NODE_ENV=production when running the command), before building any other app.
This command will create files (including your vendor DLL bundle) under build/assets/dlls. Now if you build or start an app or the whole project, it will use the vendor DLL bundle.
DllPlugin is the essential part that allows for app build parallelisation.
In order to split app builds you, firstly you need to have the vendor DLL bundle compiled and available for each
build thread/process, then to build a single app use gluestick build --client -A /.
Also remember to build the server/renderer bundle as well - gluestick build --server.

docs/configuration/CachingAndHooks.html.body:
Caching & Hooks
Caching
Caching support has been added for server side rendering. This lets you cache
entire page responses on pages where it makes sense like a home or landing
page.
Example:


Route property:
cache - boolean
Additional optional cache properties:
cacheTTL - number of seconds to store the cache for a particular route
Gluestick allows SSR component caching by using electrode-react-ssr-caching.
For using it you need to determine cacheConfig in src/config/caching.server.js
Example:
export default {
  components: {
    "Component1": {
        strategy: "simple",
        enable: true
    },
    "Component2": {
        strategy: "template",
        enable: true
    },
  },
};

Here you can find more information about cacheConfig.
Hooks
Gluestick also provide hooks which can be defined in src/gluestick.hooks.js.
You can use single hook or array of hooks like in example below. Usually you have to return modified value at the end of hook.
/* src/gluestick.hooks.js */

const preRenderFromCache = (cachedOutput) => {
  // Do something with output and return it.
  // Gluestick will render output with changes.
  return cachedOutput;
};

const postRenderRequirementsOne = (requirements) => {
  // Do something with requirements and return it.
  return requirements;
}

const postRenderRequirementsTwo = (requirements) => {
  // Here we have requirements with changes from postRenderRequirementsOne.
  return requirements;
}

const errorHook = (error) => {
  // In this hook we don't need to return value.
  // Unless you have another error hook which will be called after this one.
  console.log('Custom hook for error', error);
}

export default {
  preRenderFromCache,
  postRenderRequirements: [
    postRenderRequirementsOne,
    postRenderRequirementsTwo,
  ],
  error: errorHook,
};




